package fastjson

import (
	"testing"
)

func TestValue_Exists(t *testing.T) {
	tests := []struct {
		name     string
		json     string
		keys     []string
		expected bool
	}{
		{
			name:     "Field exists at root",
			json:     `{"name": "John"}`,
			keys:     []string{"name"},
			expected: true,
		},
		{
			name:     "Field does not exist at root",
			json:     `{"name": "John"}`,
			keys:     []string{"age"},
			expected: false,
		},
		{
			name:     "Field exists in nested object",
			json:     `{"person": {"name": "John"}}`,
			keys:     []string{"person", "name"},
			expected: true,
		},
		{
			name:     "Field does not exist in nested object",
			json:     `{"person": {"name": "John"}}`,
			keys:     []string{"person", "age"},
			expected: false,
		},
		{
			name:     "Field exists in array",
			json:     `{"people": [{"name": "John"}, {"name": "Jane"}]}`,
			keys:     []string{"people", "0", "name"},
			expected: true,
		},
		{
			name:     "Field does not exist in array",
			json:     `{"people": [{"name": "John"}, {"name": "Jane"}]}`,
			keys:     []string{"people", "1", "age"},
			expected: false,
		},
		{
			name:     "Field exists with decimal index",
			json:     `{"array": ["value1", "value2"]}`,
			keys:     []string{"array", "1"},
			expected: true,
		},
		{
			name:     "Field does not exist with decimal index",
			json:     `{"array": ["value1", "value2"]}`,
			keys:     []string{"array", "2"},
			expected: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			v, err := Parse(tt.json)
			if err != nil {
				t.Fatalf("failed to parse JSON: %v", err)
			}

			got := v.Exists(tt.keys...)
			if got != tt.expected {
				t.Errorf("Exists() = %v, want %v", got, tt.expected)
			}
		})
	}
}

