package fastjson

import (
	"testing"
)

func TestVisit(t *testing.T) {
	// Create a sample JSON object
	jsonStr := `{"key1": "value1", "key2": "value2", "key3": "value3"}`
	value, err := Parse(jsonStr)
	if err != nil {
		t.Fatalf("Failed to parse JSON: %v", err)
	}

	obj, err := value.Object()
	if err != nil {
		t.Fatalf("Failed to get object from value: %v", err)
	}

	// Prepare a slice to capture the results
	var results []string

	// Define the function to be called for each key-value pair
	f := func(key []byte, v *Value) {
		results = append(results, string(key)+": "+v.String())
	}

	// Call the Visit method
	obj.Visit(f)

	// Expected results
	expected := []string{
		"key1: value1",
		"key2: value2",
		"key3: value3",
	}

	// Check if the results match the expected output
	if len(results) != len(expected) {
		t.Fatalf("Expected %d results, got %d", len(expected), len(results))
	}

	for i, expectedResult := range expected {
		if results[i] != expectedResult {
			t.Errorf("Expected %q, got %q", expectedResult, results[i])
		}
	}
}

