func TestParseArray(t *testing.T) {
	c := &cache{}

	tests := []struct {
		input    string
		expected []*Value
		err      bool
	}{
		{
			input:    "[]",
			expected: []*Value{},
			err:      false,
		},
		{
			input:    "[1, 2, 3]",
			expected: []*Value{{t: TypeNumber, s: "1"}, {t: TypeNumber, s: "2"}, {t: TypeNumber, s: "3"}},
			err:      false,
		},
		{
			input:    "[true, false, null]",
			expected: []*Value{{t: TypeTrue}, {t: TypeFalse}, {t: TypeNull}},
			err:      false,
		},
		{
			input:    "[\"string1\", \"string2\"]",
			expected: []*Value{{t: TypeString, s: "string1"}, {t: TypeString, s: "string2"}},
			err:      false,
		},
		{
			input:    "[1, 2,]",
			expected: nil,
			err:      true,
		},
		{
			input:    "[1, 2, 3,, 4]",
			expected: nil,
			err:      true,
		},
		{
			input:    "[",
			expected: nil,
			err:      true,
		},
		{
			input:    "]",
			expected: nil,
			err:      true,
		},
		{
			input:    "[1, 2, 3, [4, 5]]",
			expected: []*Value{{t: TypeNumber, s: "1"}, {t: TypeNumber, s: "2"}, {t: TypeNumber, s: "3"}, {t: TypeArray, a: []*Value{{t: TypeNumber, s: "4"}, {t: TypeNumber, s: "5"}}}},
			err:      false,
		},
	}

	for _, test := range tests {
		result, _, err := parseArray(test.input, c, 0)
		if (err != nil) != test.err {
			t.Errorf("parseArray(%q) error = %v, wantErr %v", test.input, err, test.err)
			continue
		}
		if !test.err {
			if len(result.a) != len(test.expected) {
				t.Errorf("parseArray(%q) = %v, want %v", test.input, result.a, test.expected)
				continue
			}
			for i, v := range result.a {
				if v.t != test.expected[i].t || v.s != test.expected[i].s {
					t.Errorf("parseArray(%q)[%d] = %v, want %v", test.input, i, v, test.expected[i])
				}
			}
		}
	}
}

