func TestGetBool(t *testing.T) {
	tests := []struct {
		name     string
		json     string
		keys     []string
		expected bool
	}{
		{
			name:     "existing true value",
			json:     `{"key": true}`,
			keys:     []string{"key"},
			expected: true,
		},
		{
			name:     "existing false value",
			json:     `{"key": false}`,
			keys:     []string{"key"},
			expected: false,
		},
		{
			name:     "non-existing key",
			json:     `{"key": true}`,
			keys:     []string{"non_existing_key"},
			expected: false,
		},
		{
			name:     "invalid type (string)",
			json:     `{"key": "true"}`,
			keys:     []string{"key"},
			expected: false,
		},
		{
			name:     "invalid type (number)",
			json:     `{"key": 1}`,
			keys:     []string{"key"},
			expected: false,
		},
		{
			name:     "nested key with true value",
			json:     `{"outer": {"inner": true}}`,
			keys:     []string{"outer", "inner"},
			expected: true,
		},
		{
			name:     "nested key with false value",
			json:     `{"outer": {"inner": false}}`,
			keys:     []string{"outer", "inner"},
			expected: false,
		},
		{
			name:     "nested key non-existing",
			json:     `{"outer": {"inner": true}}`,
			keys:     []string{"outer", "non_existing"},
			expected: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			v, err := Parse(tt.json)
			if err != nil {
				t.Fatalf("failed to parse JSON: %v", err)
			}
			result := v.GetBool(tt.keys...)
			if result != tt.expected {
				t.Errorf("expected %v, got %v", tt.expected, result)
			}
		})
	}
}

