func TestCacheGetValue(t *testing.T) {
	c := &cache{}

	// Test initial value retrieval
	val1 := c.getValue()
	if val1 == nil {
		t.Fatal("Expected a non-nil value on first call to getValue")
	}

	// Test that the value is initialized correctly
	if cap(c.vs) != 1 || len(c.vs) != 1 {
		t.Fatalf("Expected cache to have 1 value, got len: %d, cap: %d", len(c.vs), cap(c.vs))
	}

	// Test subsequent value retrieval
	val2 := c.getValue()
	if val2 == nil {
		t.Fatal("Expected a non-nil value on second call to getValue")
	}

	// Test that a new value is appended
	if cap(c.vs) != 2 || len(c.vs) != 2 {
		t.Fatalf("Expected cache to have 2 values, got len: %d, cap: %d", len(c.vs), cap(c.vs))
	}

	// Test that the returned value is the last one in the slice
	if val1 == val2 {
		t.Fatal("Expected different values for consecutive calls to getValue")
	}

	// Test that the values are not reset
	val1.s = "modified"
	if val1.s == val2.s {
		t.Fatal("Expected values to be independent after modification")
	}
}

