func TestGetKV(t *testing.T) {
	obj := &Object{}

	// Test initial state
	kv1 := obj.getKV()
	if kv1 == nil {
		t.Fatal("Expected kv to be non-nil")
	}
	if len(obj.kvs) != 1 {
		t.Fatalf("Expected length of kvs to be 1, got %d", len(obj.kvs))
	}

	// Test adding a second kv
	kv2 := obj.getKV()
	if kv2 == nil {
		t.Fatal("Expected kv to be non-nil")
	}
	if len(obj.kvs) != 2 {
		t.Fatalf("Expected length of kvs to be 2, got %d", len(obj.kvs))
	}

	// Test that kvs are initialized correctly
	if kv1 == kv2 {
		t.Fatal("Expected kv1 and kv2 to be different instances")
	}

	// Test capacity and length behavior
	initialCap := cap(obj.kvs)
	for i := 0; i < initialCap; i++ {
		obj.getKV()
	}
	if cap(obj.kvs) != initialCap {
		t.Fatalf("Expected capacity to remain the same, got %d", cap(obj.kvs))
	}

	// Add one more kv to trigger an append
	kv3 := obj.getKV()
	if len(obj.kvs) != initialCap+1 {
		t.Fatalf("Expected length of kvs to be %d, got %d", initialCap+1, len(obj.kvs))
	}
	if kv3 == nil {
