			},
		},
		{
			name: "EscapedKeys",
			input: Object{
				kvs: []kv{
					{k: "key\\1", v: &Value{}},
					{k: "key\\2", v: &Value{}},
				},
				keysUnescaped: false,
			},
			expected: Object{
				kvs: []kv{
					{k: "key1", v: &Value{}},
					{k: "key2", v: &Value{}},
				},
				keysUnescaped: true,
			},
		},
		{
			name: "AlreadyUnescaped",
			input: Object{
				kvs: []kv{
					{k: "key1", v: &Value{}},
					{k: "key2", v: &Value{}},
				},
				keysUnescaped: true,
			},
			expected: Object{
				kvs: []kv{
					{k: "key1", v: &Value{}},
					{k: "key2", v: &Value{}},
				},
				keysUnescaped: true,
			},
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			tt.input.unescapeKeys()
			if !equalObjects(tt.input, tt.expected) {
				t.Errorf("expected %+v, got %+v", tt.expected, tt.input)
			}
		})
	}
}

func equalObjects(a, b Object) bool {
	if len(a.kvs) != len(b.kvs) || a.keysUnescaped != b.keysUnescaped {
		return false
	}
	for i := range a.kvs {
		if a.kvs[i].k != b.kvs[i].k {
			return false
		}
	}
	return true
}

