func TestObjectReset(t *testing.T) {
	// Create a new Object instance
	obj := &Object{
		kvs: []kv{
			{"key1", nil},
			{"key2", nil},
			{"key3", nil},
		},
		keysUnescaped: true,
	}

	// Check the initial length of kvs
	if len(obj.kvs) != 3 {
		t.Fatalf("expected kvs length to be 3, got %d", len(obj.kvs))
	}

	// Call the reset method
	obj.reset()

	// Check the length of kvs after reset
	if len(obj.kvs) != 2 {
		t.Fatalf("expected kvs length to be 2 after reset, got %d", len(obj.kvs))
	}

	// Check if keysUnescaped remains unchanged
	if obj.keysUnescaped != true {
		t.Fatalf("expected keysUnescaped to be true, got %v", obj.keysUnescaped)
	}

	// Call reset again
	obj.reset()

	// Check the length of kvs after second reset
	if len(obj.kvs) != 1 {
		t.Fatalf("expected kvs length to be 1 after second reset, got %d", len(obj.kvs))
	}

	// Call reset again
	obj.reset()

	// Check the length of kvs after third reset
	if len(obj.kvs) != 0 {
		t.Fatalf("expected kvs length to be 0 after third reset, got %d", len(obj.kvs))
	}

	// Call reset on an already empty kvs
	obj.reset()

	// Check the length of kvs remains 0
	if len(obj.kvs) != 0 {
		t.Fatalf("expected kvs length to remain 0 after reset, got %d", len(obj.kvs))
	}
}

