		{"false", valueFalse, false}, // Test for boolean false
		{"null", valueNull, false}, // Test for null
		{"123", &Value{s: "123", t: TypeNumber}, false}, // Test for number
		{"{\"key\":\"value\"}", &Value{o: Object{kvs: []kv{{k: "key", v: &Value{s: "value", t: TypeString}}}}}, false}, // Test for object with key-value
		{"[1, 2, 3]", &Value{a: []*Value{{s: "1", t: TypeNumber}, {s: "2", t: TypeNumber}, {s: "3", t: TypeNumber}}, t: TypeArray}, false}, // Test for array of numbers
		{"{\"key\":true}", &Value{o: Object{kvs: []kv{{k: "key", v: valueTrue}}}}, false}, // Test for object with boolean value
		{"{\"key\":null}", &Value{o: Object{kvs: []kv{{k: "key", v: valueNull}}}}, false}, // Test for object with null value
		{"{\"key\":123}", &Value{o: Object{kvs: []kv{{k: "key", v: &Value{s: "123", t: TypeNumber}}}}}, false}, // Test for object with number value
		{"{\"key\":\"value\", \"array\":[1, 2, 3]}", &Value{o: Object{kvs: []kv{{k: "key", v: &Value{s: "value", t: TypeString}}, {k: "array", v: &Value{a: []*Value{{s: "1", t: TypeNumber}, {s: "2", t: TypeNumber}, {s: "3", t: TypeNumber}}, t: TypeArray}}}}}}, false}, // Test for complex object
	}

	for _, test := range tests {
		v, tail, err := parseValue(test.input, c, 0)
		if (err != nil) != test.err {
			t.Errorf("parseValue(%q) error = %v, wantErr %v", test.input, err, test.err)
			continue
		}
		if err == nil && !compareValues(v, test.expected) {
			t.Errorf("parseValue(%q) = %v, want %v", test.input, v, test.expected)
		}
		if tail != "" {
			t.Errorf("parseValue(%q) did not consume all input, tail = %q", test.input, tail)
		}
	}
}

// compareValues is a helper function to compare two Value instances for equality.
func compareValues(v1, v2 *Value) bool {
	if v1 == nil || v2 == nil {
		return v1 == v2
	}
	if v1.t != v2.t || v1.s != v2.s || len(v1.a) != len(v2.a) || len(v1.o.kvs) != len(v2.o.kvs) {
		return false
	}
	for i, kv := range v1.o.kvs {
		if kv.k != v2.o.kvs[i].k || !compareValues(kv.v, v2.o.kvs[i].v) {
			return false
		}
	}
	for i, v := range v1.a {
		if !compareValues(v, v2.a[i]) {
			return false
		}
	}
	return true
}

