func TestVisit(t *testing.T) {
	// Create a sample JSON object
	jsonData := []byte(`{"key1": "value1", "key2": "value2", "key3": "value3"}`)
	parser := &Parser{}
	value, err := parser.ParseBytes(jsonData)
	if err != nil {
		t.Fatalf("Failed to parse JSON: %v", err)
	}

	obj, err := value.GetObject()
	if err != nil {
		t.Fatalf("Failed to get object from value: %v", err)
	}

	// Prepare a slice to capture the results
	var results []string

	// Define the function to be called for each key-value pair
	f := func(key []byte, v *Value) {
		results = append(results, string(key)+": "+string(v.StringBytes()))
	}

	// Call the Visit method
	obj.Visit(f)

	// Define the expected results
	expectedResults := []string{
		"key1: value1",
		"key2: value2",
		"key3: value3",
	}

	// Check if the results match the expected results
	if len(results) != len(expectedResults) {
		t.Fatalf("Expected %d results, got %d", len(expectedResults), len(results))
	}

	for i, expected := range expectedResults {
		if results[i] != expected {
			t.Errorf("Expected result %d to be %q, got %q", i, expected, results[i])
		}
	}
}

