)

func TestCacheGetValue(t *testing.T) {
	c := &cache{}

	// Test initial state
	val1 := c.getValue()
	if val1 == nil {
		t.Fatal("Expected a non-nil Value")
	}

	// Test that the value is initialized correctly
	if len(c.vs) != 1 {
		t.Fatalf("Expected cache to have 1 value, got %d", len(c.vs))
	}

	// Test getting another value
	val2 := c.getValue()
	if val2 == nil {
		t.Fatal("Expected a non-nil Value")
	}

	// Test that the cache size increases
	if len(c.vs) != 2 {
		t.Fatalf("Expected cache to have 2 values, got %d", len(c.vs))
	}

	// Test that the returned values are distinct
	if val1 == val2 {
		t.Fatal("Expected distinct Value pointers")
	}

	// Test capacity behavior
	for i := 0; i < 100; i++ {
		c.getValue()
	}
	if cap(c.vs) < 102 {
		t.Fatalf("Expected cache capacity to be at least 102, got %d", cap(c.vs))
	}
}

