func TestCacheGetValue(t *testing.T) {
	c := &cache{}

	// Test case 1: Initial state
	val := c.getValue()
	if val == nil {
		t.Error("Expected a non-nil value, got nil")
	}

	// Test case 2: Adding a value
	c.vs = append(c.vs, Value{})
	val = c.getValue()
	if val == nil {
		t.Error("Expected a non-nil value, got nil")
	}
	if len(c.vs) != 1 {
		t.Errorf("Expected length of vs to be 1, got %d", len(c.vs))
	}

	// Test case 3: Capacity increase
	c.vs = make([]Value, 0, 1) // Set capacity to 1
	val = c.getValue()
	if val == nil {
		t.Error("Expected a non-nil value, got nil")
	}
	if cap(c.vs) != 2 {
		t.Errorf("Expected capacity of vs to be 2, got %d", cap(c.vs))
	}

	// Test case 4: Retrieving the same value
	val1 := c.getValue()
	val2 := c.getValue()
	if val1 == val2 {
		t.Log("Successfully retrieved the same value from cache")
	} else {
		t.Error("Expected the same value, got different values")
	}

	// Test case 5: Ensure the value is not reset
	c.vs[0] = Value{s: "test"}
	retrievedVal := c.getValue()
	if retrievedVal.s != "test" {
