func TestUnescapeKeys(t *testing.T) {
	tests := []struct {
		name     string
		input    Object
		expected Object
	}{
		{
			name: "No keys to unescape",
			input: Object{
				kvs: []kv{
					{k: "key1", v: nil},
					{k: "key2", v: nil},
				},
			},
			expected: Object{
				kvs: []kv{
					{k: "key1", v: nil},
					{k: "key2", v: nil},
				},
			},
		},
		{
			name: "Keys with escape sequences",
			input: Object{
				kvs: []kv{
					{k: "key\\1", v: nil},
					{k: "key\\2", v: nil},
				},
			},
			expected: Object{
				kvs: []kv{
					{k: "key1", v: nil},
					{k: "key2", v: nil},
				},
			},
		},
		{
			name: "Keys already unescaped",
			input: Object{
				kvs: []kv{
					{k: "key1", v: nil},
					{k: "key2", v: nil},
				},
				keysUnescaped: true,
			},
			expected: Object{
				kvs: []kv{
					{k: "key1", v: nil},
					{k: "key2", v: nil},
				},
				keysUnescaped: true,
			},
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			tt.input.unescapeKeys()
			if !equalObjects(tt.input, tt.expected) {
				t.Errorf("expected %v, got %v", tt.expected, tt.input)
			}
		})
	}
}

func equalObjects(a, b Object) bool {
	if a.keysUnescaped != b.keysUnescaped {
		return false
	}
	if len(a.kvs) != len(b.kvs) {
		return false
	}
	for i := range a.kvs {
		if a.kvs[i].k != b.kvs[i].k {
			return false
		}
	}
	return true
}

