import (
	"testing"
)

func TestVisit(t *testing.T) {
	// Create a sample JSON object
	jsonStr := `{"key1": "value1", "key2": "value2", "key3": "value3"}`
	value, err := Parse(jsonStr)
	if err != nil {
		t.Fatalf("Failed to parse JSON: %v", err)
	}

	obj, err := value.Object()
	if err != nil {
		t.Fatalf("Failed to get object from value: %v", err)
	}

	// Prepare a map to track calls to the function f
	calls := make(map[string]string)

	// Define the function f to be called by Visit
	f := func(key []byte, v *Value) {
		calls[string(key)] = v.String()
	}

	// Call the Visit method
	obj.Visit(f)

	// Check if the calls were made in the correct order
	expectedCalls := map[string]string{
		"key1": "value1",
		"key2": "value2",
		"key3": "value3",
	}

	for key, expectedValue := range expectedCalls {
		if value, exists := calls[key]; !exists || value != expectedValue {
			t.Errorf("Expected call for key %s with value %s, got %s", key, expectedValue, value)
		}
	}
}

