	for i := 0; i < 10; i++ {
		kv := obj.getKV()
		kv.k = "key" + string(i)
		kv.v = &Value{}
	}

	if len(obj.kvs) != 11 { // 1 initial + 10 added
		t.Errorf("Expected kvs length to be 11, got %d", len(obj.kvs))
	}

	// Test that kvs are correctly populated
	for i, kv := range obj.kvs {
		if kv.k != "key"+string(i) {
			t.Errorf("Expected key to be key%d, got %s", i, kv.k)
		}
		if kv.v == nil {
			t.Errorf("Expected non-nil value for key%d", i)
		}
	}
}

