package fastjson

import (
	"testing"
)

func TestParseRawNumber(t *testing.T) {
	tests := []struct {
		input    string
		expected string
		remaining string
		err      error
	}{
		{"12345", "12345", "", nil},
		{"-123.45e+6", "-123.45e+6", "", nil},
		{"3.14abc", "3.14", "abc", nil},
		{"inf123", "inf", "123", nil},
		{"nanxyz", "nan", "xyz", nil},
		{"abc", "", "abc", fmt.Errorf("unexpected char: %q", "a")},
		{"-inf", "-inf", "", nil},
		{"-nan", "-nan", "", nil},
		{"123.45.67", "123.45", ".67", nil},
		{"", "", "", fmt.Errorf("unexpected char: %q", "")},
	}

	for _, test := range tests {
		result, remaining, err := parseRawNumber(test.input)

		if result != test.expected || remaining != test.remaining || (err != nil && test.err == nil) || (err == nil && test.err != nil && err.Error() != test.err.Error()) {
			t.Errorf("parseRawNumber(%q) = %q, %q, %v; want %q, %q, %v", test.input, result, remaining, err, test.expected, test.remaining, test.err)
		}
	}
}
